import './App.css';
import Menu from './components/Menu/menu';
import React from 'react';
import { Route, Routes, BrowserRouter } from 'react-router-dom';
import NewItem from './components/item/newItem';
import Layout from './components/layout/layout';

function App() {

  return (
    <div className="App">
      <Layout>
        <BrowserRouter>
          <Routes>
            <Route path='/' element>
              <Menu />
            </Route>
            <Route path='/new-meal'>
              <NewItem/>
            </Route>
            <Route path='/all-meal'>
              <Menu/>
            </Route>
          </Routes>
        </BrowserRouter>
      </Layout>
    </div>
  );
}


export default App;
